[pytype]
exclude = 
	**/*_test.py
	**/test_*.py
	**/*_pb2.py
	build/
	dist/
inputs = 
	ord_schema
keep_going = True
jobs = 0
output = .pytype
pythonpath = 
	.
check_attribute_types = False
check_container_types = False
check_parameter_types = False
check_variable_types = False
disable = 
	module-attr
	pyi-error
report_errors = True
precise_return = False
protocols = False
strict_import = False

[egg_info]
tag_build = 
tag_date = 0

